import {useRef} from 'react'
import style from './Header.module.css'

function Header(){
  const searchRef = useRef()

  return(
    <div className={style.body}>
      <p>Home</p>

      <div className={style.search}>
      <input type="text" ref={searchRef} />
      <p>search</p>
      </div>

      <p>something</p>
    </div>
  )
}
export default Header
